import { Link } from 'react-router-dom';
import './Header.css';
const Header = () => {
   const userDatabackend = localStorage.getItem('userData');  
   const userDatamatch = userDatabackend ?  JSON.parse(userDatabackend) : null;

   console.log(userDatamatch,"backend data")

    return(
        <>
        <header className="header">
            <div className="header-container">
                <Link to='/landingPage' className='logo'>MySite</Link>
                <nav className='navigation'>
                    <Link to="/landingPage" className='nav-link'>Home</Link>
                    <Link to="/about" className='nav-link'>About</Link>
                    <Link to="/services" className='nav-link'>Services</Link>
                    <Link to="/contact-us" className='nav-link'>Contact US</Link>
                </nav>

                <div className='header-actions'>
                    <Link to='/' className='logout-button'>logOut</Link>
                </div>
            </div>
        </header>
        </>
    )
}
export default Header;
